import Vue from 'vue'
import App from './App.vue'
// 编写导入在顶部写
import YangButton from './components/YangButtonangButton.vue'
Vue.config.productionTip = false


//进行全局注册
// vue.component(组件名，组件对象)
Vue.component('YangButton', YangButton)
new Vue({
  render: h => h(App),
}).$mount('#app')
//与el：''作用一致为选择器，指定为vue管理的容器
